<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./p-r-o-f-i-l-e-check-out-history.css" />

    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Notable:wght@400&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Noto Music:wght@400&display=swap"
    />
    <link

  <body>
    <div class="profile-check-out-history">
      <div class="mask-group-container" id="groupContainer">
        <div class="mask-group3">
          <img

            src="./assets/btslogopng9-1@2x.png"
          />
        </div>
        <div class="group-child14"></div>
      </div>
      <img
        class="profile-check-out-history-child"

          <div class="search3">SEARCH</div>

        class="profile-check-out-history-item"
        alt=""
        src="./assets/frame-19.svg"
      />
      <div class="profile-check-out-history-inner1">
        <div class="rectangle-frame">
          <img class="rectangle-icon" alt="" src="./assets/rectangle-24@2x.png" />
        </div>
      </div>
      <div class="check-out-history1">CHECK OUT HISTORY</div>
      <div class="ratings-alphabetical-recent-container">
        <span class="ratings">RATINGS</span> ALPHABETICAL RECENT
